import React, { useState } from 'react';
import {
  IonContent,
  IonHeader,
  IonList,
  IonPage,
  IonRefresher,
  IonRefresherContent,
  IonTitle,
  IonToolbar,
  useIonViewWillEnter,
  IonButtons,
  IonBackButton,
  IonButton,
  IonIcon
} from '@ionic/react';
import './FinishesandPatinas.css';
import { chevronBack, ellipsisVerticalOutline } from 'ionicons/icons';

const FinishesandPatinas: React.FC = () => {



  return (
    <IonPage id="FinishesandPatinas">
      <IonHeader>
        <IonToolbar>
          <IonButtons  slot="start">
          <IonBackButton defaultHref=".." icon={chevronBack} />
        </IonButtons>
          <IonTitle>Metal Finishes and Patinas
          </IonTitle>
          <IonButtons slot="end">
          <IonButton>
            <IonIcon slot="icon-only" icon={ellipsisVerticalOutline}/>
          </IonButton>
        </IonButtons>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>

      </IonContent>
    </IonPage>
  );
};

export default FinishesandPatinas;
